      description: "Get ready for best night ever presenting &quot;Tidings of Jazz & Joy&quot; with Keiko Matsui & Euge Groove, featuring Lindsey Webster & Adam Hawley! At Sycuan Casino on December 6th, at 8PM.\n\nKeiko Matsui - Keiko Matsui’s music speaks to the hearts and souls of fans around the world, transcending borders and building bridges among people who share a common appreciation of honest artistry and cultural exchange. \n\nEugene Grove - Steven Eugene Grove, better known as Euge Groove, is a chart-topping multi-instrumentalist found prominence as a saxophonist for such remarkable acts as Tower of Power, Joe Cocker, Eurythmics, Huey Lewis & the News, Elton John, Bonnie Raitt, Aaron Neville, and Richard Marx.\n\nLindsey Webster - From the first note, Lindsey Webster captivates listeners. Her rich, soulful voice enchants a dedicated following who connect with the raw emotion she shares with them.\n\nAdam Hawley - Adam Hawley, started his music career in the Portland Metro Area of Oregon before moving to Southern California in 2002. He has performed and/or recorded in a myriad of settings with many popular artists.\n\nNow, these Pop Musician troops are stepping down at Sycuan Casino to meet us. Isn’t it much Excited? With this same Excitement let us get involved with their live performance.\nPurchase your tickets now: https://goo.gl/dQ6SfH\n\nLocation: 5469 Casino Way, El Cajon, CA 92019, USA"
