      description: " with Dude York<br> Im just some random from Melbourne. Alex Lahey likes to keep it real. The 24-year-old Australian musician takes her rise up the ranks from music student to an artist with one of the most highly anticipated debut albums of 2017 in her stride. Lahey sees her life as ordinary: I fall in love, I have a family, I go out with my friends, I like to have a drink. However, most people cant distil those universal experiences into wry, punchy indie-rock songs - three minute odes to millennial angst and all the complicated feelings that come with it. Alex Lahey can. Love You Like A Brother is proof. Born and raised in Melbourne, Lahey initially studied jazz saxophone at university but unimpressed with learning music in such a regimented way she switched to an arts degree (see her B-Grade University EP for more details). Her tenure with cult music collective Animaux allowed Lahey the musical anarchy she yearned - hell, she booked the band their first gig before theyd even prepared a single song. Lahey stepped out on her own once she began to write songs that didnt fit Animauxs party space. Songs that were inspired the two people she considers the greatest songwriters of all time, Dolly Parton and Bruce Springsteen. Songs that got her noticed at a local industry conference and scored her a solo management deal. Lahey had graduated. The Love You Like A Brother album drops fresh off the back of Laheys breakthrough in 2016. Last year her You Dont Think You Like People Like Me single was inescapable and landed her a spot in Australian radio network triple js prestigious Hottest 100 of 2016. The songs universal tale of rejection took Lahey global - its message, she says, is the flipside of the usual break-up scenario: Yeah, youre right. Its not me. It IS you. And that no-shit-taken attitude is the backbone of Love You Like A Brother. From the stomping title track Brother to the gently moving Money, Laheys debut long-player tells it like it is. The album found Lahey back in the studio with production partner, and one-half of Holy Holy, Oscar Dawson (Ali Barter, British India). The pair pushed each other to create an intimate sonic experience that comprises scuzzy guitars thrumming over pop melodies, helmed by Laheys unfussy but arresting vocals. The albums songs traverse the everyday themes of family, heartbreak and identity. Lacey tells her stories with character and dry humour Ive figured it out, she sings in Awkward Exchange, youre a bit of a dick but there are also moments of darkness. In Taking Care she muses, Ive gained weight and I drink too much, maybe thats why you dont love me as much. Taking Care was written after Alex had an eye-opening conversation with her mother. I was seeing someone who I knew wasnt treating me well, and chose to ignore it, and I think my mum had picked up on it as well. She just said to me at the end of the conversation, Alexandra, whatever you do, just make sure that you take care of yourself. The poignant Backpack is a tribute to Laheys latest relationship, and the unsure start it got off to. When we first started going out, they warned me about how theyre really flighty, and I was like, I just want you to stay. And I dont know if you are. Its just saying its hard to hold someone down if theyre always thinking about the next place that theyre going to. Its hard to give someone a hug when theyre walking away. And sometimes its good to chase them down and be like, Hey, Im here. And, in case the albums title hadnt given it away already, theres a track for her brother too. We dont get a choice/So lets stick together, screams Lahey in Brother. That angsty love youre hearing is easily explained by Lahey, My brother and I clashed for a long time, and then all of a sudden as adults, were really close. I feel like this song is my gift to him. The themes of Alex Laheys album might be universal, but its the unique approach she takes unpacking them thats earned her millions of Spotify streams, buzz-worthy showcases at SXSW and festival sets alongside the likes of Flume, The Kills, At The Drive-In and James Blake as well as guesting on tours with Catfish & The Bottlemen, Tegan & Sara and Blondie."
