      description: " Calling all Superheroes and Villains. It&#39;s time to show off your superpower while dancing the night way at our annual Sheraton Carlsbad Family Friendly Superhero vs Villain New Years Eve Bash! Come dressed in your favorite hero (or villain) or come as you are, but prizes will be given to the Best Dressed Family and Best Dressed Couple! Doors open at 6:30pm. A special guest appearance your family and friends wont want to miss, so don&#39;t be late! Enjoy a night filled with superb food, drinks, entertainment, childrens activities and unforgettable memories. Indulge at the adult and child buffet style dinner and dessert bar with live DJ that&#39;s sure to keep everyone on the dance floor. The Kids Party Zone is back this year and bigger than ever, consisting of our GAMER ROOM with Xbox, Kinect, Dance Central, racing games and Wii. Other rooms include face painting, ping pong, foosball, billiards, and the Kids Club Party Zone. The clock strikes midnight twice at this bash. The Kids Club Party Zone will be counting down with a balloon drop on east coast time at 9pm. At midnight we will be ringing in the New Year with a complimentary champagne toast, live count down and balloon drop. Don&#39;t miss out on the family fun festivities taking place at Sheraton Carlsbad Superheroes and Villains New Year&#39;s Eve Bash! For those of you who partake in our Hero or Villain Ball theme, we will be awarding the Best Dressed Family and Best Dressed Couple! Attire is up to you, but its a great excuse to show off your power or favorite holiday outfit. PLEASE NOTE: Children cannot be left unattended on property. (Childcare is not provided) We recommend purchasing tickets in advance, we have sold out every year and we anticipate it will happen again. Please note though tickets for Children 3 and under are free, pre-purchased tickets are required. PRICING: WE WILL ONCE AGAIN SELL OUT, NO TICKETS AVAILABLE AT THE DOOR OR FRONT DESK Adults must present ID at Check In Early Bird Pricing: Purchase October 14th - December 29th $110 per Adult Ages: 18 and older $60 per Child Ages: 13 17 $50 per Child Ages: 4 12 (kids buffet) FREE Ages 3 and under (kids buffet) Please note an event ticket is still required. Purchase December 30th - December 31st $130 per Adult Ages: 18 and older $85 per Child Ages: 13 17 $65 per Child Ages: 4 12 (kids buffet) FREE Ages 3 and under (kids buffet) Please note an event ticket is still required. PLEASE NOTE: Children cannot be left unattended. (Childcare is not provided)<br> <br> \n"
